window.bookSummaryJSON = "<p>Press play on this compilation of bonus content from the Rock Chick series by Kristen Ashley.</p> <p>The stories of the Hot Bunch and Rock Chicks continue in the hero’s point of view for one more chapter in each book. What happens when Lee and Indy run into Cherry at the Mexican Joint? When Eddie first sees his purple bathroom? What’s Christmas like with Herb and Trish? What was going on with Boo after Jules got shot?</p> <p>Find out all of this and more in the <i>Rock Chick Bonus Tracks</i>, now available in one anthology.</p>"; 
